import React, { useEffect } from "react";
import { NavLink } from "react-router-dom";

const Footer = () => {
  useEffect(() => {
    console.log("Footer component mounted");
    return () => {
      console.log("Footer component unmounted");
    };
  }, []);

  return (
    <footer className="bg-gradient-to-r from-indigo-100 via-blue-100 to-teal-100 dark:bg-gray-900 text-gray-700 dark:text-gray-300 mt-10 shadow-inner">
      <div className="max-w-screen-xl mx-auto px-6 py-10 md:py-12">
        <div className="flex flex-col md:flex-row justify-between items-center">
          <ul className="flex flex-wrap gap-6 text-sm font-medium mb-6 md:mb-0">
            <li>
              <NavLink to="/about" className="hover:text-teal-600 transition">
                About
              </NavLink>
            </li>
            <li>
              <NavLink to="/privacy" className="hover:text-teal-600 transition">
                Privacy Policy
              </NavLink>
            </li>
            <li>
              <NavLink to="/license" className="hover:text-teal-600 transition">
                Licensing
              </NavLink>
            </li>
            <li>
              <NavLink to="/contact" className="hover:text-teal-600 transition">
                Contact
              </NavLink>
            </li>
          </ul>
        </div>

        <hr className="my-6 border-gray-300 dark:border-gray-700" />

        <p className="text-center text-sm">
          © 2023{" "}
          <a
            href="https://flowbite.com/"
            target="_blank"
            rel="noopener noreferrer"
            className="hover:underline text-teal-600"
          >
            Flowbite™
          </a>{" "}
          — All rights reserved.
        </p>
      </div>
    </footer>
  );
};

export default Footer;
